	var filterAgenda = function(type){
		// 0-> on going
		// 1-> upcoming
		// 2-> ended
		 if(type === "all"){
		 	mData.body[0].slot_data.sort((a, b) => {
			    return a.status - b.status;
			});
			return mData.body[0].slot_data;
		 }else{
			 var arrT = mData.body[0].slot_data.filter(function(it){
			 	if(it.status === type){
			 		return it
			 	}
			 })
			 return arrT;
		}
	}

